Tube for high flow ventilation through tracheostomy
Designed for invasive irrigation and oxygen delivery with positive pressure; With special film that reduces condensation; Soft  flexible;
Tube length with connector 38-40 cm; The patient has a strap attached to the neck that holds the tube to prevent tension and the patient is free to move the head without removing the tube from the tracheostomy; Supplied clip for additional tube attachment; Lightweight  flexible  corrugated tube;
Connector tube and contour outer diameter - 22mm  inner diameter 20mm; No latex; Rotating around your axis; Flow range 10-60 L / min; Resistance to flow @ 40 L / min (combined with respiratory contour) - 0.49 kPa (5 cm H2O); Technically compatible with Fisher & Paykel's Airvo 2 and MR850 high-flow humidifiers and a plug-in circuit;
Used for ≥ 7 days.

LOT_DESCRIPTION_ORIGINAL:
Vamzdelis aukštos tėkmės ventiliacijai per tracheostomą
Skirtas invaziniam drėkinimui ir deguonies tiekimui su teigiamu slėgiu; Su specialia plėvele  kuri mažina kondensatą; Minkštas  lankstus;
Vamzdelio ilgis su konektoriumi 38-40 cm; Ant paciento kaklo kabinamas dirželis  kuris prilaiko vamzdelį  kad nebūtų tempimo ir pacientas galėtų laisvai judinti galvą  neištraukiant vamzdelio iš tracheostomos; Komplektuojamas klipsas  papildomam vamzdelio tvirtinimu; Lengvas  lankstus  gofruotas vamzdelis;
Konektoriaus  jungiančio vamzdelį ir kontūrą  išorinis diametras -  22mm  vidinis diametras 20mm; Be latekso; Besisukantis aplink savo ašį; Tėkmės diapazonas 10-60 L/min; Pasipriešinimas tėkmei @ 40 L/min (kartu skaičiuojant su kvėpavimo kontūru) – 0 49 kPa (5 cm H2O); Techniškai suderintas su Fisher&Paykel aukštos tėkmės drėkintuvu „Airvo 2“  ir „MR850“ bei prijungiamu kontūru;
Naudojamos ≥7 dienos.
